import React, { Fragment } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './App.css';
import Paid from "./Paid/Paid";
import Home from "./Home/Home";
import List from "./List/List";
import ContactUs from "./Login";
import Product from "./Product";


function App() {
  return (

    <Router>
    <nav class="navbar navbar-light bg-light justify-content-between">
      <Link to="/Home" class="navbar-brand">Navbar</Link>
      <Link to="/Paid" class="navbar-brand">Navbar</Link>
      <Link to="/List" class="navbar-brand">Navbar</Link>
      <Link to="/ContactUs" class="navbar-brand">ContactUs</Link>
      <Link to="/Product" class="navbar-brand">Product</Link>

      <form class="form-inline">
        <input class="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" />
        <button class="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
      </form>
    </nav>

    <Route path="/" component={Home} exact />
    <Route path="/Home" component={Home} exact />
    <Route path="/Paid" component={Paid} exact />
    <Route path="/List" component={List} exact />
    <Route path="/ContactUs" component={ContactUs} exact />
    <Route path="/Product" component={Product} exact />






    </Router>


  );
}

export default App;
